import React, { useState } from 'react'
import { addDays, format, subDays } from 'date-fns';
import axios from '../commons/axios';
import { baseURL } from '../commons/helper';

const ApplicationForm = () => {

    const [englishName, setEnglishName] = useState('');
    const [chineseName, setChineseName] = useState('');
    const [gender, setGender] = useState('');
    const [dob, setDob] = useState('');
    const [address, setAddress] = useState('');
    const [pob, setPob] = useState('');
    const [availableDate, setAvailableDate] = useState('');
    const [timeSlot, setTimeSlot] = useState('');
    const [vaccineBrand, setVaccineBrand] = useState('');
    const [venue, setVenue] = useState('');




    // const handleSubmit = (e) => {
    //     e.preventDefault();
    //     // Perform your validation here
    //     // Send form to server
    // };

    const minDate = format(addDays(new Date(), 3), 'yyyy-MM-dd');
    const timeslots = Array.from({ length: 11 }, (_, i) => i + 10).flatMap(hour => [
        `${hour % 12 === 0 ? 12 : hour % 12}:00 ${hour < 12 ? 'AM' : 'PM'} to ${hour % 12 === 0 ? 12 : hour % 12}:30 ${hour < 12 ? 'AM' : 'PM'}`,
        `${hour % 12 === 0 ? 12 : hour % 12}:30 ${hour < 12 ? 'AM' : 'PM'} to ${(hour + 1) % 12 === 0 ? 12 : (hour + 1) % 12}:00 ${(hour + 1) < 12 ? 'AM' : 'PM'}`,
    ]);

    const yesterday = format(subDays(new Date(), 1), 'yyyy-MM-dd');

    // 
    const handleSubmit = async (e) => {
        e.preventDefault();

        try {
            const response = await axios.post(`${baseURL}/create-application`, {
                englishName,
                chineseName,
                gender,
                dob,
                address,
                pob,
                availableDate,
                timeSlot,
                vaccineBrand,
                venue
            });

            console.log('Application successful:', response.data);
            alert('Application successful!');
            // Handle successful registration
        } catch (error) {
            console.error('Application failed:', error.response.data);
            alert('Application failed!');
            // Handle Application failure
        }
    };





    return (
        <div className='application-form'>
            <div className="container">
                <form onSubmit={handleSubmit}>
                    <div className="field">
                        <label className="label">English Name</label>
                        <div className="control">
                            <input
                                className="input"
                                type="text"
                                name="englishName"
                                value={englishName}
                                onChange={(e) => setEnglishName(e.target.value)}
                                required
                            />
                        </div>
                    </div>

                    <div className="field">
                        <label className="label">Chinese Name</label>
                        <div className="control">
                            <input className="input" type="text" name="chineseName" onChange={handleChange} required />
                        </div>
                    </div>
                    <div className="field">
                        <label className="label">Gender</label>
                        <div className="control">
                            <div className="select">
                                <select name="gender" onChange={handleChange} required>
                                    <option value="">Select gender</option>
                                    <option value="male">Male</option>
                                    <option value="female">Female</option>
                                </select>
                            </div>
                        </div>
                    </div>
                    <div className="field">
                        <label className="label">Date of Birth</label>
                        <div className="control">
                            <input className="input" type="date" name="dob" max={yesterday} onChange={handleChange} required />
                        </div>
                    </div>
                    <div className="field">
                        <label className="label">Address</label>
                        <div className="control">
                            <input className="input" type="text" name="address" onChange={handleChange} required />
                        </div>
                    </div>
                    <div className="field">
                        <label className="label">Place of Birth</label>
                        <div className="control">
                            <div className="select">
                                <select name="pob" onChange={handleChange} required>
                                    <option value="">Select Country</option>
                                    <option value="hongkong">Hong Kong</option>
                                    <option value="china">China</option>
                                    <option value="uk">United Kingdom</option>
                                    <option value="us">United States</option>

                                </select>
                            </div>
                        </div>
                    </div>

                    {/* keep  */}
                    <div className="field">
                        <label className="label">Available Dates</label>
                        <div className="control">
                            <input className="input" type="date" min={minDate} name="availableDate" onChange={handleChange} required />
                        </div>
                    </div>
                    <div className="field">
                        <label className="label">Time Slot</label>
                        <div className="control">
                            <div className="select">
                                <select name="timeSlot" onChange={handleChange} required>
                                    <option value="">Select Time Slot</option>
                                    {timeslots.map(time => (
                                        <option key={time} value={time}>{time}</option>
                                    ))}
                                </select>
                            </div>
                        </div>
                    </div>
                    <div className="field">
                        <label className="label">Venue</label>
                        <div className="control">
                            <div className="select">
                                <select name="venue" onChange={handleChange} required>
                                    <option value="">Select Venue</option>
                                    <option value="private_clinic">中環 - 皇后大道中9號2101室</option>
                                    <option value="children_center">九龍灣 - 海濱匯 - 海濱道77號2樓7號舖</option>
                                    <option value="public_clinic">上水 - 上水廣場 - 龍琛路39號1303A 5號舖</option>
                                </select>
                            </div>
                        </div>
                    </div>
                    <div className="field">
                        <label className="label">Vaccine Brand</label>
                        <div className="control">
                            <div className="select">
                                <select name="vaccineBrand" onChange={handleChange} required>
                                    <option value="">Select Vaccine Brand</option>
                                    <option value="community_center">科興</option>
                                    <option value="private_clinic">復必泰</option>
                                </select>
                            </div>
                        </div>
                    </div>

                    {/* subit button */}
                    <div className="field">
                        <div className="control">
